import React from "react";
import SummaryOwnContent from './SummaryOwnContent'
import ProfileImg2 from '../../../profile1.jpg'
import ProfileImg3 from '../../../profile3.jpeg'

function SummaryYouOwn(props){
    var id=0;
    var arr= [];
    props.userdata.map(item=>{
        if(arr.indexOf(item.name) === -1){
            arr.push(item.name)
        }    
    })
    const summaryOwn =[]; arr.map(items=>{
            props.userdata.filter(item=>{
                if(item.name === items){
                    console.log(item.name+" , "+item.amount)
                    return <SummaryOwnContent key={item.id} aClass="sumary-you-own-inside-p" url={ProfileImg3} amount={(item.amount)/2} name={item.name}/>
                }
            })
            // if(props.userdata[i].name === item){
            //     console.log(props.userdata[i].name+" , "+props.userdata[i].amount)
            // }
    })
    return (
        <div className="you-are-owe">
            {summaryOwn}
        </div>
    )
}

export default SummaryYouOwn
